import React from "react";
import "./";

function Header() {
  return (
    <header className="header">
      <div className="logo">MyWebsite</div>
      <nav className="nav-links">
        <a href="#hero">Home</a>
        <a href="#gallery">Gallery</a>
        <a href="#events">Events</a>
        <a href="#newsletter">Newsletter</a>
      </nav>
    </header>
  );
}

export default Header;
